import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <div>
        <div>
          <h2>Full Stack</h2>
          <p>Web developter, designing applications for mobile phones and desktop using CSS, HTML, Node, React, and Ruby. </p>
        </div>
      </div>
    );
  }
}

export default Home;
